const buttons = document.querySelectorAll('button')
const simFlow = document.querySelector('feTurbulence')
let vertFlow = 0.22
simFlow.setAttribute('baseFrequency','0.05 0.9')
const steps = 30
const interval = 10

buttons.forEach(function(button){
 button.addEventListener('mouseover',function(){
  vertFlow = 0.00001

  for (i=0; i<steps; i++){
   setTimeout(function(){
   vertFlow += 0.001
   simFlow.setAttribute('baseFrequency', vertFlow + '0.00001')
   }, i*interval)
  }
  setTimeout(function(){
   vertFlow = 0.00001
   simFlow.setAttribute('baseFrequency', vertFlow + '0.00001')
  }, steps*interval)
 })
})






